import PaperPlane from "../../../svg/paperplane.svg"
import { useState } from "react"
import TextareaAutosize from "react-textarea-autosize"

const CenterForm = ({
	sendCommand,
	deleteGeneration,
	regenerateGeneration,
	delilahWorking,
	predictedCommands,
	loadingPredictedCommands,
}) => {
	const [textFieldValue, setTextFieldValue] = useState("")

	const submitForm = (e) => {
		e.preventDefault()
		sendCommand("general", textFieldValue)
		setTextFieldValue("")
	}

	return (
		<form
			onSubmit={submitForm}
			className='w-3/5 absolute mx-auto left-0 right-0 bottom-8 bg-white rounded-2xl drop-shadow-2xl'
		>
			<div className='flex flex-row ml-2 mt-2'>
				<button
					className='bg-red-100 text-red-600 py-1 px-4 rounded mr-2 text-sm flex flex-row w-fit items-center'
					type='button'
					onClick={deleteGeneration}
				>
					<i className='fa-solid fa-trash'></i>
					<p className='ml-2'>Delete Last</p>
				</button>

				<button
					className='bg-green-100 text-green-600 py-1 px-4 rounded mr-2 text-sm flex flex-row w-fit items-center'
					type='button'
					onClick={regenerateGeneration}
				>
					<i className='fa-solid fa-arrows-rotate'></i>
					<p className='ml-2'>Regenerate Last</p>
				</button>
			</div>

			<div className='flex flex-col'>
				<div className='w-full p-2 hover:cursor-pointer text-center'>
					{loadingPredictedCommands ? (
						<>
							<p className='text-sm font-bold'>Loading Predicted Commands</p>
						</>
					) : (
						<>
							{predictedCommands.length > 0 ? (
								<>
									{predictedCommands.map((command, index) => {
										return (
											<p
												key={index}
												className='text-sm text-gray-500 hover:text-gray-700 hover:cursor-pointer border-[1px] border-gray-300 rounded-md p-1 m-1 hover:bg-gray-100 w-fit mx-auto'
												onClick={() => {
													sendCommand("general", command)
												}}
											>
												{command}
											</p>
										)
									})}
								</>
							) : (
								<p className='text-sm font-bold'>No Predictions</p>
							)}
						</>
					)}
				</div>

				<div className='px-4 flex flex-row justify-center items-center w-full align-middle'>
					<div className='w-full flex flex-col justify-left justify-top items-left p-3'>
						<TextareaAutosize
							className='flex-2 font-md p-2 focus:outline-none focus:ring-none focus:border-none resize-none'
							type='text'
							value={textFieldValue}
							onChange={(e) => setTextFieldValue(e.target.value)}
							placeholder='Talk to Delilah...'
							maxRows={3}
							onKeyDown={(e) => {
								if (e.key === "Enter") {
									submitForm(e)
								}
							}}
						/>
					</div>

					<button className='bg-[#7C55D6] p-3 rounded-lg' type='submit'>
						<img src={PaperPlane} alt='paperplane' className='paperplane' />
					</button>
				</div>
			</div>
		</form>
	)
}

export default CenterForm
